var autorizacionUrl=global_settings.urlCORS+"api/autorizacionapi/";registrationModule.factory("autorizacionRepository",function(r){return{getAll:function(t){return r.get(autorizacionUrl+"1-"+t)},aprobar:function(t,o,i,n){return r.get(autorizacionUrl+"2-"+t+"-"+o+"-"+i+"-"+n)},add:function(t){return r.post(autorizacionUrl,t)},"delete":function(){return r["delete"](autorizacionUrl)},put:function(t){return r.put(autorizacionUrl,t)}}});